// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

import "../lib/alt_bn128.sol";
// import "../PubParam.sol";

contract PartialEqualtiy {

  using alt_bn128 for uint256;
  using alt_bn128 for alt_bn128.G1Point;

  // PubParam private pp;
  // alt_bn128.G1Point[] gs;

  // constructor (address pp_addr) {
  //   gs = PubParam(pp_addr).gs();
  // }

  // function setup(uint256[] x, uint256[] y, uint[] idx_unequal) public pure returns () {

  // }

  struct Sig {
    alt_bn128.G1Point c;
    uint256[] zs;
  }

  /// @param x witness
  /// @param y witness
  /// @param idx_ne unequal indices
  function sign(alt_bn128.G1Point[] memory gs, uint256[] memory x, uint256[] memory y, uint256[] memory idx_ne) 
  public view returns (Sig memory sig) {
    require(x.length == y.length, "PartialEqualtiy: witness unequal length");
    uint l = idx_ne.length;
    require (l <= x.length);

    uint256[] memory rs = new uint256[](l);
    alt_bn128.G1Point memory c = alt_bn128.G1Point(0, 0);

    for (uint i = 0; i < l; i++) {
      rs[i] = alt_bn128.random();
      c = c.add(gs[idx_ne[i]].mul(rs[i]));
    }
    /// @dev Fiat-Shamir 
    uint256 e = uint256(keccak256(abi.encode(c)));

    for (uint i = 0; i < l; i++) {
      rs[i] = rs[i].add(alt_bn128.sub(x[i], y[i]).mul(e));
    }

    sig = Sig({
      c : c,
      zs : rs
    });
  }

  function verify (alt_bn128.G1Point[] memory gs, uint256[] memory idx_ne, Sig memory sig) public view {

  }

}

